INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "お！\nあそこに困ってそうな人発見！", 2, 1, 1.4, 1, 0, "春咲 ひより", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1001);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "大切な人を\n守れるようになりたい…って", 2, 1, 1.4, 1, 0, "草野 優衣", "みんなみたいに\nわたしも強くならなきゃ", 1, 0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1002);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "キミに必要な集中力と感性が", 2, 1, 1.4, 1, 0, "士条 怜", "フェンシングを始めてみては？", 1, 0, 0, "少しは磨かれると思いますよ。", 1003);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "今日はなにして遊ぶ？", 2, 1, 1.5, 1, 0, "穂高 みそぎ", "ねぇ、にいちゃん！", 1, 0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", 1004);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "ねぇ…", 2, 1, 1.4, 1, 0, "風宮 あかり", "風宮あかりです", 1, 0, 0, "私といっしょに…\nいかない？", 1006);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "プリンたべたいのー", 2, 1, 1.5, 1, 0, "出雲 宮子", "出雲宮子なのー", 1, 0, 0, "食べ物の恨みは怖いのー", 1007);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 2, 1, 1.4, 1, 0, "虹村 雪", "ボクは虹村雪。", 1, 0, 0, "いいよ。\n見られることは運命さ…", 1008);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 2, 1, 1.4, 1, 0, "柊杏奈", "フッ…聞いて後悔するがいい！", 1, 0, 0, "人呼んで「疾風の冥姫」!!", 1009);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 2, 1, 1.5, 1, 0, "姫宮 真歩", "マホマホ王国のプリンセス、\nまほ姫どす", 1, 0, 0, "ほんまおおきにやわ～♪", 1010);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 2, 1, 1.4, 1, 0, "衣之咲 璃乃", "衣之咲璃乃です！", 1, 0, 0, "ここで会ったが\n100年目～！", 1011);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "ち、超能力って…\n何のことかな～？", 2, 1, 1.4, 1, 0, "柏崎 初音", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 0, 0, "…って、お願い！\n誰にも言わないでおいて～！", 1012);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "一応カリスマ読モJKやってまっす！", 2, 1, 1.4, 1, 0, "美波 鈴奈", "ちょす！\n美波鈴奈だよ～♪", 1, 0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1016);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "東京は遊園地みたいなところさー", 2, 1, 1.4, 1, 0, "喜屋武 香織", "はいたーい。\n喜屋武香織さー。", 1, 0, 0, "でも、沖縄もとってもいいとこさー", 1017);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "先生って呼ばれるのは\nくすぐったいから", 2, 1, 1.4, 1, 0, "支倉 伊緒", "支倉伊緒です。", 1, 0, 0, "イオちゃんって呼んでね。", 1018);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 2, 1, 1.5, 1, 0, "茜 ミミ", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 0, 0, "ミミをおいてかないでぇ～", 1020);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "あの……\nふぇ……", 2, 1, 1.5, 1, 0, "栗林 くるみ", "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 0, 0, "ふぇぇぇぇぇん……", 1021);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "こんな私に貴重な時間を\n割いていただき、", 2, 1, 1.4, 1, 0, "風宮 より", "風宮よりです。\nあああああ！", 1, 0, 0, "なんてありがとうございます！", 1022);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "おにいちゃんどこいくの？\nえ？", 2, 1, 1.5, 1, 0, "北条 綾音", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 0, 0, "私こっち行きたいー\nね、早く早くー", 1023);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 2, 1, 1.4, 1, 0, "天野 すずめ", "わっ…わっ…私、\n天野すずめといいます！", 1, 0, 0, "これて何か違う…\nあああすみません！", 1025);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "あなたは…運命の……\n伴侶……", 2, 1, 1.4, 1, 0, "倉石 恵理子", "……クスクス…私は\n…倉石恵理子……", 1, 0, 0, "離しませんわ………\n絶対に…!!", 1027);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 2, 1, 1.4, 1, 0, "佐々木 咲恋", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 0, 0, "…そうでしょ？？", 1028);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 2, 1, 1.4, 1, 0, "桜井 望", "桜井望だよ！\nよろしくねっ", 1, 0, 0, "あはは、\n私もまだまだだなぁ～", 1029);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 2, 1, 1.4, 1, 0, "ニノン・ジュベール", "デケデケデンっ！", 1, 0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", 1030);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 2, 1, 1.4, 1, 0, "上喜 しのぶ", "上喜しのぶです。\n手元のドクロが父です。", 1, 0, 0, "おかしいですね……", 1031);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "けんども\nそれには足りないモンが…", 2, 1, 1.5, 1, 0, "野戸まひる", "目指すはビッグな\nお笑い芸人だっぺ！", 1, 0, 0, "そう、\nオラのボケに突っ込める相方が…！", 1033);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "ちょっと緊張しちゃって…", 2, 1, 1.4, 1, 0, "綾瀬 ゆかり", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 0, 0, "ちょ\nちょっと一杯飲んできます…！", 1034);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "知らない人とは話しちゃいけないので", 2, 1, 1.5, 1, 0, "氷川 鏡華", "氷川鏡華…です", 1, 0, 0, "これ以上お話しすることは…\nないです！", 1036);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "……あ、アラーム。", 2, 1, 1.4, 1, 0, "柏崎 栞", "柏崎…栞です。", 1, 0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1038);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "私、一人も友達がいなくて……", 2, 1, 1.4, 1, 0, "双葉 碧", "ふ、双葉碧です。", 1, 0, 0, "野に咲く花が、\n唯一の話相手です。", 1040);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 2, 1, 1.4, 1, 0, "三角 千歌", "三角千歌です。", 1, 0, 0, "そう思っています。", 1042);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "あぁ？\nお前のそいつの仲間か？", 2, 1, 1.4, 1, 0, "安芸 真琴", "安芸真琴だ。", 1, 0, 0, "う、疑ってすまなかったな…", 1043);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "生けとし生ける全ての者よ！", 2, 1, 1.4, 1, 0, "イリヤ・オーンスタイン", "わらわこそは夜を総べる者！", 1, 0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1044);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "ぐふふふふ……はっ！", 2, 1, 1.4, 1, 0, "遠見 空花", "そこで騎士は妖精を乱暴に……", 1, 0, 0, "ｌク、クウカに何かご用ですか!?", 1045);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 2, 1, 1.4, 1, 0, "宮坂たまき", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", 1046);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "それでは早速クエストに…", 2, 1, 1.4, 1, 0, "大神 美冬", "大神美冬よ！", 1, 0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1048);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "クエストもバトルも\n掃除も洗濯も", 2, 1, 1.4, 1, 0, "星野静流", "星野静流だよ！", 1, 0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1049);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "見ての通りの\nセクシー美少女で", 2, 1, 1.5, 1, 0, "玉泉美咲", "アタシは玉泉美咲。", 1, 0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", 1050);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "？？？？", 2, 1, 1.4, 1, 0, "リマ", "？？？", 1, 0, 0, "？？？？", 1052);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1.5, 1, 0, "モニカ・ヴァイスヴィント", "モニカ・ヴァイスヴィントだ。", 1, 0, 0, "そ、そこまでいうなら\nもらってやる", 1053);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1.5, 1, 0, "ペコリーヌ", "モニカ・ヴァイスヴィントだ。", 1, 0, 0, "そ、そこまでいうなら\nもらってやる", 1058);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1.5, 1, 0, "コッコロ", "モニカ・ヴァイスヴィントだ。", 1, 0, 0, "そ、そこまでいうなら\nもらってやる", 1059);
INSERT INTO `v1_4df1f74cef64d18adfbd60e196adcd245819f97cbaab53a0453bc1a7a15a35a4` VALUES (0, 0, "菓子でつろうなどと\n稚拙な策を……", 2, 1, 1.5, 1, 0, "キャル", "モニカ・ヴァイスヴィントだ。", 1, 0, 0, "そ、そこまでいうなら\nもらってやる", 1060);
